// Обновляем мета-поле для hotels
function update_all_seo_links_hotels() {
  $args = array(
    'posts_per_page'   => -1,
    'post_type'        => 'site',
    'suppress_filters' => true 
  );
  $posts_array = get_posts( $args );
  foreach($posts_array as $post_array) {
    $links = update_seo_links();
    $current_seo_links = get_post_meta($post_array->ID, 'treba_seo_links_new');
    // Для тех, у кого еще не заполнено мета-поле, добавляем элементы (условно для новых страниц)
    if (empty($current_seo_links)) {
      update_post_meta($post_array->ID, 'treba_seo_links_new', $links); 
    }
  }
}

add_action('new_to_publish', 'update_all_seo_links_hotels');
add_action('draft_to_publish', 'update_all_seo_links_hotels');
add_action('pending_to_publish', 'update_all_seo_links_hotels');
